import React, { useEffect, useState } from 'react';
import AgentTable from './components/AgentTable';
import ExportButton from './components/ExportButton';
import { fetchAllAgents } from './api/agentApi';

function App() {
  const [agents, setAgents] = useState([]);
  const [loading, setLoading] = useState(true);

  const [search, setSearch] = useState('');
  const [sortBy, setSortBy] = useState('deployed_at');
  const [sortOrder, setSortOrder] = useState('desc');

  const [status, setStatus] = useState('');
  const [owner, setOwner] = useState('');
  const [framework, setFramework] = useState('');

  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 10;

  const fetchData = () => {
    setLoading(true);
    fetchAllAgents({
      search,
      sort_by: sortBy,
      sort_order: sortOrder,
      status,
      owner,
      framework,
      skip: (currentPage - 1) * itemsPerPage,
      limit: itemsPerPage
    })
      .then(data => {
        setAgents(data.active_agents.concat(data.archived_agents));
        setLoading(false);
      })
      .catch(err => {
        console.error('Error:', err);
        setLoading(false);
      });
  };

  useEffect(() => {
    fetchData();
  }, [search, sortBy, sortOrder, status, owner, framework, currentPage]);

  return (
    <div style={{ padding: '20px' }}>
      <h1>AgentOps Dashboard</h1>

      {/* Search Box */}
      <div style={{ marginBottom: '10px' }}>
        üîç <input
          type="text"
          placeholder="Search by name"
          value={search}
          onChange={e => {
            setSearch(e.target.value);
            setCurrentPage(1); // Reset to page 1
          }}
        />
      </div>

      {/* Filter Dropdowns */}
      <div style={{ display: 'flex', gap: '10px', marginBottom: '10px' }}>
        <select value={status} onChange={e => { setStatus(e.target.value); setCurrentPage(1); }}>
          <option value="">All Statuses</option>
          <option value="active">Active</option>
          <option value="inactive">Inactive</option>
          <option value="maintenance">Maintenance</option>
        </select>

        <select value={owner} onChange={e => { setOwner(e.target.value); setCurrentPage(1); }}>
          <option value="">All Owners</option>
          <option value="Team-A">Team-A</option>
          <option value="Team-B">Team-B</option>
          <option value="Team-C">Team-C</option>
          <option value="Team-D">Team-D</option>
          <option value="Team-Z">Team-Z</option>
          <option value="ownerX">ownerX</option>
        </select>

        <select value={framework} onChange={e => { setFramework(e.target.value); setCurrentPage(1); }}>
          <option value="">All Frameworks</option>
          <option value="LangChain">LangChain</option>
          <option value="LangGraph">LangGraph</option>
          <option value="AutoGen">AutoGen</option>
        </select>
      </div>

      {/* Export */}
      <ExportButton />

      {/* Table + Pagination */}
      {loading ? (
        <p>Loading...</p>
      ) : (
        <>
          <AgentTable
            agents={agents}
            onSortChange={(col) => {
              setSortBy(col);
              setSortOrder(sortOrder === 'asc' ? 'desc' : 'asc');
              setCurrentPage(1); // Reset to page 1 on sort
            }}
          />

          <div style={{ marginTop: '10px' }}>
            <button
              disabled={currentPage === 1}
              onClick={() => setCurrentPage(prev => prev - 1)}
            >
              ‚óÄ Previous
            </button>

            <span style={{ margin: '0 10px' }}>Page {currentPage}</span>

            <button
              onClick={() => setCurrentPage(prev => prev + 1)}
            >
              Next ‚ñ∂
            </button>
          </div>
        </>
      )}
    </div>
  );
}

export default App;
